post.description:
Bulk sync analytics data by executing the corresponding lambda functions on AWS.
Possible analytics:
    - features-usage:
        Mandatory parameters to provide for this analytic:
            - start_date
            - end_date
            - usage_days (1 or 7)
        Request example:
        {
            "analytics_bulk_sync": {
                "analytic_name": "features-usage",
                "start_date": "2023-07-29",
                "end_date": "2023-07-31",
                "usage_days": 7
            }
        }

    - firmwares-adoption:
        No parameters to provide
        Request example:
        {
            "analytics_bulk_sync": {
                "analytic_name": "firmwares-adoption",
            }
        }

    - engagement-rate:
        Mandatory parameters to provide for this analytic (Only one date, no bulk sync):
            - start_date
        Request example:
        {
            "analytics_bulk_sync": {
                "analytic_name": "firmwares-adoption",
                "start_date": "2023-07-29",
            }
        }
